class InstagramBusinessAccount {
  InstagramBusinessAccount({
      String? id, 
      String? name, 
      String? username, 
      String? profilePictureUrl, 
      Media? media,}){
    _id = id;
    _name = name;
    _username = username;
    _profilePictureUrl = profilePictureUrl;
    _media = media;
}

  InstagramBusinessAccount.fromJson(dynamic json) {
    _id = json['id'];
    _name = json['name'];
    _username = json['username'];
    _profilePictureUrl = json['profile_picture_url'];
    _media = json['media'] != null ? Media.fromJson(json['media']) : null;
  }
  String? _id;
  String? _name;
  String? _username;
  String? _profilePictureUrl;
  Media? _media;
InstagramBusinessAccount copyWith({  String? id,
  String? name,
  String? username,
  String? profilePictureUrl,
  Media? media,
}) => InstagramBusinessAccount(  id: id ?? _id,
  name: name ?? _name,
  username: username ?? _username,
  profilePictureUrl: profilePictureUrl ?? _profilePictureUrl,
  media: media ?? _media,
);
  String? get id => _id;
  String? get name => _name;
  String? get username => _username;
  String? get profilePictureUrl => _profilePictureUrl;
  Media? get media => _media;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['id'] = _id;
    map['name'] = _name;
    map['username'] = _username;
    map['profile_picture_url'] = _profilePictureUrl;
    if (_media != null) {
      map['media'] = _media?.toJson();
    }
    return map;
